// src/App.js
import React from "react";
import { BrowserRouter as Router, Routes, Route, NavLink } from "react-router-dom";
import Dashboard from "./pages/Dashboard";
import MapView from "./pages/MapView";
import "./style.css";

function App() {
  return (
    <Router>
      <div className="dashboard-container">
        {/* Simple top nav */}
        <nav style={{ marginBottom: 16, display: "flex", gap: 12 }}>
          <NavLink
            to="/"
            style={({ isActive }) => ({
              textDecoration: "none",
              padding: "6px 10px",
              borderRadius: 999,
              border: "1px solid #e0e0e0",
              background: isActive ? "#1976d2" : "#ffffff",
              color: isActive ? "#ffffff" : "#222",
              fontSize: 13,
            })}
            end
          >
            Dashboard
          </NavLink>
          <NavLink
            to="/map"
            style={({ isActive }) => ({
              textDecoration: "none",
              padding: "6px 10px",
              borderRadius: 999,
              border: "1px solid #e0e0e0",
              background: isActive ? "#1976d2" : "#ffffff",
              color: isActive ? "#ffffff" : "#222",
              fontSize: 13,
            })}
          >
            Map view
          </NavLink>
        </nav>

        <Routes>
          <Route path="/" element={<Dashboard />} />
          <Route path="/map" element={<MapView />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
